def Authenticate_Application = context.expand( '${Authenticate Application#Response#$.ResponseStatus}')
def getDashboard = context.expand( '${getDashboard#Response#$.ResponseStatus}')
def trackerCurrentProfile = context.expand( '${trackerCurrentProfile#Response#$.ResponseStatus}')
def trackerCurrentBeforeProfile = context.expand( '${trackerCurrentBeforeProfile#Response#$.ResponseStatus}')
def trackerCurrentAfterProfile = context.expand( '${trackerCurrentAfterProfile#Response#$.ResponseStatus}')
def TAC_API = context.expand( '${TAC_API#Response#$.ResponseStatus}')
//def organizationBranding = context.expand( '${organizationBranding#Response#$.ResponseStatus}')
def getMemberProfile = context.expand( '${getMemberProfile#Response#$.ResponseStatus}')
def getMemberInsurance = context.expand( '${getMemberInsurance#Response#$.ResponseStatus}')
def getSecurityQuestions = context.expand( '${getSecurityQuestions#Response#$.ResponseStatus}')
def getMemberCredentials = context.expand( '${getMemberCredentials#Response#$.ResponseStatus}')
def updateContactDetails = context.expand( '${updateContactDetails#Response#$.ResponseStatus}')
def updatePreferences = context.expand( '${updatePreferences#Response#$.ResponseStatus}')
def updateSecurityqa = context.expand( '${updateSecurityqa#Response#$.ResponseStatus}')
def uploadProfilePic = context.expand( '${uploadProfilePic#Response#$.ResponseStatus}')
def trackerCurrentProfileAfterUpload = context.expand( '${trackerCurrentProfileAfterUpload#Response#$.ResponseStatus}')
def updateUsername = context.expand( '${updateUsername#Response#$.ResponseStatus}')
def updateOriginalUsername = context.expand( '${updateOriginalUsername#Response#$.ResponseStatus}')
def updatePassword = context.expand( '${updatePassword#Response#$.ResponseStatus}')
def updateDeafultPassword = context.expand( '${updateDeafultPassword#Response#$.ResponseStatus}')
def getInsurer = context.expand( '${getInsurer#Response#$.ResponseStatus}')

log.info(getInsurer)
if ((Authenticate_User == "OK") && (Authenticate_Application == "OK") && (getDashboard == "OK") && (trackerCurrentProfile == "OK") && (trackerCurrentBeforeProfile == "OK") && (trackerCurrentAfterProfile == "OK") && (TAC_API == "OK")  && (getMemberProfile == "OK") && (getMemberInsurance == "OK")  && (getSecurityQuestions == "OK") && (getMemberCredentials == "OK") && (updateContactDetails == "OK") && (updatePreferences == "OK") && (updateSecurityqa == "OK") && (uploadProfilePic == "OK") && (trackerCurrentProfileAfterUpload == "OK") && (updateUsername == "OK") && (updateOriginalUsername == "OK") && (updatePassword == "OK") && (updateDeafultPassword == "OK") && (getInsurer == "OK"))
{
	def res = "Passed"
	return res.toString()
}
else
{
	def res="Failed"
	return res.toString()
}

def expected = context.expand( '${getData#Expected}' )
def actual = context.expand( '${statusGen#Actual}' )
log.info(expected)

def res = "Failed"
if (expected==actual)
{
	 res = "Passed"
	return res.toString()
}

return res.toString()
